   "source": [
    "### 2.2. Text classification on the IMDB Dataset<a id=\"text\"></a>\n",
    "\n",
    "Here we will classify movie reviews as positive or negative using the text of the review. This is an example of binary ‚Äî or two-class ‚Äî classification, an important and widely applicable kind of machine learning problem.\n",
    "\n",
    "We‚Äôll use the IMDB dataset that contains the text of 50,000 movie reviews from the Internet Movie Database. These are split into 25,000 reviews for training and 25,000 reviews for testing. The training and testing sets are balanced, meaning they contain an equal number of positive and negative reviews.\n",
    "\n",
    "Based on https://keras.rstudio.com/articles/tutorial_basic_text_classification.html\n",
    "\n",
    "**Download the IMDB dataset**\n",
    "\n",
    "The IMDB dataset comes packaged with Keras. It has already been preprocessed such that the reviews (sequences of words) have been converted to sequences of integers, where each integer represents a specific word in a dictionary.\n",
    "\n",
    "The following code downloads the IMDB dataset (again, ___Internet___ must be switched on in the Kaggle Notebook Settings)"
   ]
  },
