   "source": [
    "Notice the training loss decreases with each epoch and the training accuracy increases with each epoch. This is expected when using gradient descent optimization ‚Äî it should minimize the desired quantity on every iteration.\n",
    "\n",
    "This isn‚Äôt the case for the validation loss and accuracy ‚Äî they seem to peak after about twenty epochs. This is an example of overfitting: the model performs better on the training data than it does on data it has never seen before. After this point, the model over-optimizes and learns representations specific to the training data that do not generalize to test data.\n",
    "\n",
    "For this particular case, we could prevent overfitting by simply stopping the training after twenty or so epochs.\n",
    "\n",
